import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import './index.css';

function Hello() {
  return <h1>Hello</h1>;
}

function World() {
  return <h2>World!</h2>;
}

class Greet extends Component {
  render() {
    return (
      <div>
        <Hello />
        <World />
      </div>
    );
  }
}

ReactDOM.render(
  <React.StrictMode>
    <Greet />
  </React.StrictMode>,
  document.getElementById('root')
);
